create table districts
(
    id            int auto_increment
        primary key,
    name          varchar(255) null,
    province_code varchar(4)   null comment '省份编码',
    city_code     varchar(4)   null comment '城市编码',
    county_code   varchar(4)   null comment '区县编码',
    level         tinyint      null
)
    auto_increment = 3217;

